import React, { Component, Fragment } from 'react';
import { Link } from 'react-router-dom';
// import './stylesheets/App.css';

class PhoneDetailContainer extends Component {
    render() {
        const { phoneList } = this.props;
        return (
            <Fragment>
                <div>
                    <h1>{phoneList.name}</h1>
                    <h2>{phoneList.title}</h2>
                    <img
                        src={phoneList.image}
                        alt={phoneList.name}
                        title={phoneList.name}
                    />
                    <ul>
                        Colors:
                    {phoneList.map(phone => {
                            return (
                                <li key={phone.id}>
                                    {phone.color}
                                </li>
                            );
                        })}
                    </ul>
                    <p>{phoneList.price}</p>
                </div>
                <Link to="/">Home</Link>
            </Fragment>
        );
    }
}

export default PhoneDetailContainer;
